import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';

// Public Pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import SearchTrips from './pages/SearchTrips';
import TripDetails from './pages/TripDetails';
import Booking from './pages/Booking';
import Footer from './components/layout/Footer';

// Admin Pages
import AdminDashboard from './pages/admin/AdminDashboard';
import AdminVehicles from './pages/admin/AdminVehicles';
import AdminRoutes from './pages/admin/AdminRoutes';
import AdminSchedule from './pages/admin/AdminSchedule';
import CreateSchedule from './pages/admin/CreateSchedule';
import AdminAnalytics from './pages/admin/AdminAnalytics';
import CustomerServicePortal from './pages/admin/CustomerServicePortal';

// User Pages
import UserProfile from './pages/user/UserProfile';
import UserBookings from './pages/user/UserBookings';
import BookingDetails from './pages/user/BookingDetails';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen">
          <div className="flex-grow">
            <Routes>
              {/* Public Routes */}
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/search" element={<SearchTrips />} />
              <Route path="/trip/:id" element={<TripDetails />} />
              <Route path="/booking/:tripId" element={<Booking />} />

              {/* Admin Routes */}
              <Route path="/admin/dashboard" element={<AdminDashboard />} />
              <Route path="/admin/vehicles" element={<AdminVehicles />} />
              <Route path="/admin/routes" element={<AdminRoutes />} />
              <Route path="/admin/schedules" element={<AdminSchedule />} />
              <Route path="/admin/create-schedule" element={<CreateSchedule />} />
              <Route path="/admin/analytics" element={<AdminAnalytics />} />
              <Route path="/admin/customer-service" element={<CustomerServicePortal />} />

              {/* User Routes */}
              <Route path="/profile" element={<UserProfile />} />
              <Route path="/bookings" element={<UserBookings />} />
              <Route path="/booking-details/:id" element={<BookingDetails />} />
            </Routes>
          </div>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
